type grid_ship = (int*int)list; 

fun make_horiz (0) = [] : grid_ship
	      |	make_horiz (x) = (x-1,0)::(make_horiz(x-1));

fun make_vert 0 = [] : grid_ship
	     | make_vert x = (0,x-1)::(make_vert(x-1));

fun shift([]:grid_ship,(a,z)) = []:grid_ship 
| shift (aship,(0,0)) = aship 
| shift ([(x,y)],(a,z)) = [(x+a,y+z)]  
| shift (((x,y)::xs),(a,z)) = (x+a,y+z)::shift(xs,(a,z));

